import React, { Component } from 'react';
import '../css/SocialFollow.css';

class SocialFollow extends Component{
    render(){
        return(
            <div className="Social">
              <ul>
                <li><img
                  src = {require("../images/FACE.png")}
                  style={{width:35, marginTop: 0}}
                  alt = "Could not load"
                  className = "Social"
                  href="www.facebook.com"
                /></li>
                <li>
                  <a href="www.facebook.com">
                  <img
                  src = {require("../images/TWITT.png")}
                  style={{width:35, marginTop: 0}}
                  alt = "Could not load"
                  className = "Social"
                  />
                  </a>
                </li>
                <li><img
                  src = {require("../images/INSTAGRAM.png")}
                  style={{width:35, marginTop: 0}}
                  alt = "Could not load"
                  className = "Social"
                /></li>
                <li><a href="www.mail.google.com"><i class="fas fa-envelope-open-text"></i> Subscribe</a></li>
              </ul>
            </div>
        );
    }
}

export default SocialFollow;
